import {createStore} from 'redux'
import logInReducer from '../reducers/logIn'

const store = createStore(logInReducer, window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__());

export default store;
